INSERT INTO `prform` VALUES ('<html><basefont size=1>\r\n<html><head><title>Preventative Agreement</title></head>\r\n\r\n\r\n<table align=\"center\" border=0 cellpadding=10 cols=3 width=\"95%\">\r\n<tr><td> \r\n<IMG SRC=\"http://127.0.0.1:8080/servsys/markemeachem.gif\" NAME=\"CompLogo\" ALIGN=LEFT WIDTH=110 HEIGHT=110 BORDER=0><BR CLEAR=LEFT>\r\n</td>\r\n<font size=2><td><P ALIGN=CENTER ><b>Mark E. Meacham, Inc.<br>\r\n<i>Your Comfort Is Our Business</i><br>Heating * Air Conditioning * Indoor Air Quality<br>\r\n253A Worcester Road, Charlton MA 01507<br>\r\n(508) 248-5551 * (800) 328-7350</b></b>\r\n</font></td>\r\n</tr>\r\n</table>\r\n\r\n<h2 align=CENTER>Planned Service Agreement</h2>\r\n\r\n<P ALIGN=LEFT><table><tr>\r\n<td>This agreement is issued to:</td><td>%customername%</td></tr> \r\n<tr><td>By <b>Mark E. Meacham, Inc.</b> on:</td><td>%agreementdate%</td></tr> \r\n<tr><td>Covering equipment located at:</td><td><br>%address1% <br>%city%, %state%  %zip% </td></tr>\r\n</table></p> \r\n\r\n%equipmenttable%\r\n\r\n<br><b>%additionalservice%</b></br>\r\n\r\n<P ALIGN=LEFT FONT=\"-1\"><h3 ALIGN=LEFT>TERMS OF THIS AGREEMENT:</h3> \r\nWe agree to provide %totalvisits% inspection and maintenance visits as specified on both pages of this agreement. The inspection \r\n and maintenance services to be performed during the heating and/or cooling seasons by <b>Mark E. Meacham, Inc.</b> by one of our qualified technicians. Maintenance dates may vary depending on weather and scheduling.<br><br>\r\nCustomer agrees to have an adult homeowner or authorized representative on-site during each maintenance visit. The approximate time for our maintenance visit is (residential between 45 minutes and 1 hour per unit)/(commercial 2-3 hours). Customer agrees to operate the specified equipment per our instructions. \r\nIt is important for the customer to notify us in the event of any unusual operating conditions such as fumes, noise, etc. Customer agrees to permit only our Maintenance / Service Technicians to work on the specified equipment.\r\n\r\n<h3>CONDITIONS:</h3>\r\n1. Service parts not covered under warranty will be charged at regular rates less <b>20% preferential customer discount</b>.<br> \r\n2. Maintenance workmanship is guaranteed for thirty (30) days from the date of inspection. All parts and equipment are warranted per manufacturers specifications.<br> \r\n3. Repair services requested by the customer will be provided during normal working hours (8:00am - 4:30pm) - at our current service rate less preferential customer discount noted above.<br> \r\n4. Request for emergency service after normal working hours will be charged at our current service rate less preferential customer discount.<br>\r\n5. This agreement is non-refundable and may be assigned.\r\n\r\n<h3>ADDITIONAL BENEFITS:</h3>\r\n1. Automatic professional cleaning and maintenance.<br> \r\n2. Priority customer repair service.<br> \r\n3. Discount on all parts.<br> \r\n4. Up to date information on safety and energy saving accessories.<br> \r\n5. Increased efficiency of your unit.<br> \r\n6. Written evaluation of your equipment.<br> \r\n7. Extended life of your equipment.<br> \r\n8. Agreement is transferable to different owner.<br> \r\n9. Protection of price increases.\r\n\r\n<h3>TERMS AND CONDITIONS</h3>\r\n1. This planned service agreement contains the entire understanding between Mark E. Meacham, Inc. (The Company) and the Customer. Any modifications, amendments or changes must be in writing and signed by both parties.<br> \r\n2. The Company shall not be liable for damage, loss or delays resulting from fire, explosion, flooding, the elements, labor troubles or any other cause beyond our control.<br> \r\n3. The Company shall not be responsible for the identification, detection, abatement, encapsulation, storage, removal or transportation of any regulated or hazardous substances. Regulated or hazardous substances may include, but are not limited to asbestos, certain refrigerants, and refrigerant oils.  \r\nIf any such products or materials are encountered during the course of work, the company can discontinue work until regulated or hazardous materials have been removed or hazard or liability is eliminated.<br> \r\n4. No maintenance appointments will be scheduled before 8:00 A.M. or beginning after 3:30 P.M. - Monday through Friday. Hours or days may be changed at the discretion of The Company without notice.\r\n\r\n<h3><u>DEFINITIONS:</u></h3> \r\n<b>Priority Service:</b> We will not accept non-service agreement customer emergencies before we will respond to Planned Service Agreement customer emergencies.<br> \r\n<br><b>Professionally Cleaned:</b> Due to time and cost, not every component of the system is cleaned or checked during a normal maintenance call. We maintain those items that the HVAC industry and the manufacturer typically accepts as part of routine scheduled maintenance. We do not check every electrical and mechanical component on your system unless a problem leads us to do so. e.g. cleaning of the evaporator coil is done at additional cost if necessary. This coil should only have to be cleaned every third or fourth year if a high efficiency air cleaner is used, more frequently if the standard fiberglass filter is used.<br> \r\n<br><b>Emergency Service:</b> Any situation where the Customer is in immediate danger due to a safety issue, i.e. gas leak, gas smell, threat of carbon monoxide, water leak or is without heat and there is a potential danger of frozen pipes and property damage. <u>Typically being without air conditioning is not considered an emergency</u>, unless there is a health related issue.<br><br><br> \r\n\r\n<h3>PRICE OF THIS AGREEMENT: <b>%price%</b></h3> \r\n<br><br>\r\n<table width=\"95%\" align=center><tr><td>____________________________</td><td>_______</td><td>____________________________</td><td>_______</td></tr> \r\n<tr><td>Customer Signature</td><td>Date</td><td>The Company</td><td>Date</td></tr> \r\n<tr><td>%customername%</td><td></td><td>%techname%</td><td></td></tr></table> \r\n<br><br>%visittable%<br><br>\r\n</http>\r\n');
UNLOCK TABLES;
/*!40000 ALTER TABLE `prform` ENABLE KEYS */;

